import { Block, Modality } from '../../types'
import { Stack } from '@mui/material'
import { DummyBlockMeta } from '../../constants'
import { useTooltip } from '../../hooks/useTooltip'
import { useTooltipContext } from '../../context'
import { MediaViewerContainer } from './MediaViewerContainer'

export const Tooltip = () => {
  const { tooltipInfo } = useTooltipContext()
  const { onMouseOverTooltipComponent, onMouseLeaveTooltipComponent } = useTooltip()

  if (!tooltipInfo?.blockSvg) {
    return null
  }

  const block = JSON.parse(tooltipInfo.blockSvg.data ?? '').block as Block | undefined

  if (!block || block.blockType === 'input') {
    return null
  }

  const meta = block.meta ?? DummyBlockMeta
  return (
    <Stack
      direction={'column'}
      style={{
        position: 'fixed',
        width: 250,
        top: tooltipInfo.event?.clientY,
        left: tooltipInfo.event?.clientX,
        zIndex: 10000,
      }}
      onMouseEnter={onMouseOverTooltipComponent}
      onMouseLeave={onMouseLeaveTooltipComponent}
    >
      <div
        style={{
          backgroundColor: 'rgba(100,100,100, 0.9)',
          padding: '12px',
          width: 250,
          borderRadius: '10px',
          color: 'white',
          direction: 'ltr',
        }}
      >
        <div
          style={{
            fontWeight: 'bold',
            fontSize: '20px',
          }}
        >
          Description
        </div>
        <div style={{ fontSize: '20px' }}>{meta.description}</div>
        <div style={{ height: '10px', backgroundColor: 'transparent' }}></div>
        <div
          style={{
            fontWeight: 'bold',
            fontSize: '20px',
          }}
        >
          Runtime
        </div>
        <div style={{ fontSize: '20px' }}>{meta.properties?.maxRuntime}</div>
        <div style={{ height: '10px', backgroundColor: 'transparent' }}></div>
        <div
          style={{
            fontWeight: 'bold',
            fontSize: '20px',
          }}
        >
          Example input
        </div>

        <div
          style={{
            display: 'flex',
            flexDirection: 'column',
            rowGap: '10px',
            fontSize: '20px !important',
          }}
        >
          {Object.entries(meta.exampleInput ?? {}).map(([modality, content], index) => {
            if (Array.isArray(content)) {
              return (
                <div key={index} className='flex flex-col gap-1'>
                  {content.map((c, index) => (
                    <MediaViewerContainer key={index} content={c} modality={modality as Modality} />
                  ))}
                </div>
              )
            }
            return (
              <MediaViewerContainer key={index} content={content} modality={modality as Modality} />
            )
          })}
        </div>
        <div style={{ height: '10px', backgroundColor: 'transparent' }}></div>
        <div
          style={{
            fontWeight: 'bold',
            fontSize: '20px',
          }}
        >
          Example output
        </div>
        <div style={{ fontSize: '20px !important' }}>
          <MediaViewerContainer
            modality={block.outputModality}
            content={meta.exampleOutput || ''}
          />
        </div>
      </div>
    </Stack>
  )
}
